import React from "react";
const Product = ({cart}) => {
  return (
<div className="" >
  <div>
 <p>  {cart.title}</p>
    </div>
  <div>
    <p>
      
      {cart.description}
      </p>
      </div>
  <div>
    <img src= {cart.image} alt="Product" />
  </div>
  <div>
    <p> {cart.price} </p>
  </div>
  <button>
    {
      false ? <p>Remove Item:</p> : <p>Add To Cart</p>
    }
  </button>
</div>
  );
};

export default Product;
